import React, { Component } from 'react'

class Base extends Component{
    render(){
        return(
            <div className='main'>
                <h1>Quest.</h1>
                <style jsx>
                    {`
                        .main{
                            background: #000;
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default Base;
